-- Matthew Gregory 4/10/2016 edit so compatable with MG's system

/* A 10% sample of the schools in the PDS has been taken (about 6700 buildings). This will be used to run the Blockbuster model. 
The code below pulls together data from 3 different tables in the Capital database. 
The establishment table contains data about the establishments, the buildings table contains data about each of the buildings
and the conditions table contains data about each element at these buildings. There are approx 270k rows - one for every element in the 
sample of c6700 buildings. 
*/



use SFD

select
a.businessunitid as 'businessunitid'
, a.buildingid as 'buildingid'
, a.siteid as 'siteid'
, b.ElementID as 'elementid'
, a.LANo as 'lano'
, a.DfENo as 'dfeno'
, a.URN as 'urn'
, a.[Site Reference] as 'site_ref'
, a.[Block Reference] as 'block_ref'
, B.Element as 'element'
, b.[Sub-Element] as 'sub_element'
, b.[Construction Type] as 'const_type'
, b.[Constr. Type Accessible] as 'const_type_accessible'
, b.grade
, b.priority as 'priority'
, b.[Cost (£)] as 'cost'
, b.composition 
, a.[No of storeys] as 'storeys'
, a.[Gross internal floor area (m2)] as 'gifa'
, a.[Ground Floor GIFA (m2)] as 'ground_gifa'
, a.[Perimeter (m)] as 'block_perimeter'
, a.[Height (m)] as 'height'
, case when 
	a.WindowsandDoors is null then 0
	else a.WindowsandDoors
	end as 'windows_doors'
, case when 
	a.[No of Lifts] is null then 0 
	else a.[No of lifts] 
	end as 'number_lifts'
, c.[Site area excluding playing fields (m2)] as 'site_area_exc_field'
, c.[Boundary (m)] as 'boundary_length'
, c.[Playing field area (m2)] as 'field_area'
, c.[Swimming pool] as 'swimming_pool'
from 
	[Capital].[PDSBuilding2014-11-21] as a
left outer join 
	[Capital].[PDSCondition2014-11-21] as b
	on a.buildingid = b.buildingid
left join 
	[Capital].[PDSEstablishment2014-11-21] as c
	on a.urn = c.urn

where 
